]); for j in 1..=self.log { self.update(i >> j); } } /// Apply a map `f` to the element in an interval [l, r). fn apply_range(&mut self, l: usize, r: usize, f: &F) { if l == r { return; } let (mut l, mut r) = (l + self.size, r + self.size); for i in (1..=self.log).rev() { if ((l >> i) << i) != l { self.push(l >> i); } if ((r >> i) << i) != r { self.push((r - 1) >> i); } } let (l2, r2) = (l, r); while l < r { if l & 1 == 1 { self.all_apply(l, f); l += 1; } if r & 1 == 1 { r -= 1; self.all_apply(r, f); } l >>= 1; r >>= 1; } l = l2; r = r2; for i in 1..=self.log { if ((l >> i) << i) != l { self.update(l >> i); } if ((r >> i) << i) != r { self.update((r - 1) >> i); } } } fn max_right<C: Fn(&S) -> bool>(&mut self, l: usize, g: C) -> usize { if l == self.n { return self.n; } let mut l = l + self.size; for i in (1..=self.log).rev() { self.push(l >> i); } let mut sm = S::e(); loop { while l & 1 == 0 { l >>= 1; } if !g(&sm.opr(&self.data[l])) { while l < self.size { self.push(l); l <<= 1; if g(&sm.opr(&self.data[l])) { sm = sm.opr(&self.data[l]); l += 1; } } return l - self.size; } sm = sm.opr(&self.data[l]); l += 1; if l & ((!l) + 1) != l { break; } } self.n } fn min_left<C: Fn(&S) -> bool>(&mut self, r: usize, g: C) -> usize { if r == 0 { return 0; } let mut r = r + self.size; for i in (1..=self.log).rev() { self.push((r - 1) >> i); } let mut sm = S::e(); loop { r -= 1; while r > 1 && r & 1 == 1 { r >>= 1; } if !g(&self.data[r].opr(&sm)) { while r < self.size { self.push(r); r = (r << 1) + 1; if g(&self.data[r].opr(&sm)) { sm = self.data[r].opr(&sm); r -= 1; } } return r + 1 - self.size; } sm = self.data[r].opr(&sm); if r & ((!r) + 1) == r { break; } } 0 }
